import React from 'react';
import {View, Text,StyleSheet} from 'react-native';
import Title from './Title';

const SetQuiz = () =>{
    return (
        <View style={styles.container}>
            <Title/>
            <Text style={{fontSize:30, fontWeight:'600', marginBottom:20}}>Quiz Question</Text>
            <View style={styles.modalView}>

            </View>

        </View>
    )
}
const styles = StyleSheet.create({
    container:{
        backgroundColor: '#00798c',
        alignItems: 'center',
        justifyContent: 'center',
        marginTop:25,
        marginLeft:10,
        marginRight:10,
        borderRadius:10,
        height:'100%'
        
       },
       modalView:{
       marginBottom:180,
       justifyContent:'center',
       alignItems:'center', 
       width:500,
       height:500,
       backgroundColor:'white',
       borderRadius:20,
       shadowColor:'#bbb',
       shadowOpacity:0.80,
       elevation:5
   },
})
export default SetQuiz;
